import React from "react";

function Calendar() {
    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold mb-4">Calendar</h1>
            <p>This is the Calendar page where users can view scheduled tasks.</p>
        </div>
    );
}

export default Calendar;
